import React from "react";
import FormLogin from "./form";
import "./styles.scss";
import "bootstrap/dist/css/bootstrap.min.css";

const Login = () => {
  return (
    <div className="login">
      <section className="login__section">
        <div className="col login-section--container">
          <h1 className="login__section--title">
            Aplicación
            <br />
            OLSoftware
          </h1>
          <p className="login__section--container--subtitle">
            Prueba práctica Front-end senior
          </p>
        </div>

        <div className="login__section--container--login">
          <FormLogin />
        </div>
      </section>
    </div>
  );
};

export default Login;
